import React, { Component } from 'react';
import './Login.css';
import Nav from "pages/Nav";

class Login extends Component {
    render() {
        return (
            <div>
                <Nav />
                <div>
                    <span>로그인</span>
                </div>
            </div>
        );
    };
}

export default Login;
